import Link from 'next/link'

const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"]
const linkStyle = {
  marginRight: 15
}

const Header = () => {
  return (
    <div>
    {services_array.map(service => {
    if (service === "Prabhakar Mishra") {
      return (
        <Link href={`/`}>
          <a style={linkStyle}>{service}</a>
        </Link>
      )
    }
    return (
      <Link href={`/${service}`}>
        <a style={linkStyle}>{service}</a>
      </Link>
  )})}
  </div>
);
}

export default Header



